import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';
import Education from './Education';

export default class Resume extends Component {
    render() {
        return (
            <div>
                <Grid>
                    {/*Right Side*/}
                    <Cell col={4}>
                        <div style={{textAlign: 'center'}}>
                            <img src="https://cdn1.iconfinder.com/data/icons/avatars-1-5/136/87-512.png" alt="avtar" style={{height: '200px'}}/>
                        </div>
                        <h2 style={{paddingTop: '2em'}}>Manju Arya</h2>
                        <h4 style={{color: 'gray'}}>Programmer</h4>
                        <hr style={{borderTop: '3px solid #833fb2', width: '50%'}}/>
                        <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.
                            Mauris sagittis pellentesque lacus eleifend lacinia...</p>
                            <hr style={{borderTop: '3px solid #833fb2', width: '50%'}}/>
                        <h5>Address</h5>
                        <p>#123, Bandhagen, Stockholm</p>
                        <h5>Phone</h5>
                        <p>072 768 9251</p>
                        <h5>Email</h5>
                        <p>mann.arya@gmail.com</p>
                        <h5>Web</h5>
                        <p>https://github.com/manjuarya</p>
                        <hr style={{borderTop: '3px solid #833fb2', width: '50%'}}/>
                    </Cell>

                    {/*Left Side*/}
                    <Cell className="resume-right-col" col={8}>
                        <h2>Education</h2>
                        <Education
                            endYear={2020}
                            schoolName={'SDA-7, KTH, Sweden'}
                            schoolDescription={'Software development'}
                        />
                        <Education
                            endYear={2005}
                            schoolName={'Electronics and Communication Engineering from Uttar Pradesh Technical, UP, India'}
                            schoolDescription={'B-Tech'}
                        />
                    </Cell>
                </Grid>
            </div>
        )
    }
}
